<!-- Sydney start -->
<script>//Sydney buildings html setup 	
var itemsHTMLCollection = document.getElementsByClassName('Syd');
var itemsArray = Array.from(itemsHTMLCollection);
var html = document.documentElement;

//input setup		
var input = {
	scrollY: {
		start: 0,
		end: html.scrollHeight -window.innerHeight,
		current: 0, 
	},
	mouseX: {
		start: 0,
		end: window.innerWidth,
		current: 0,
	},
	mouseY: {
		start: 0,
		end: window.innerHeight,
		current: 0,
	}
};
input.scrollY.range = input.scrollY.end - input.scrollY.start;
input.mouseX.range = input.mouseX.end - input.mouseX.start;
input.mouseY.range = input.mouseY.end - input.mouseY.start;	

//output setup	
var output = {
	x:{
		/* increasing value move object right */
		start: 5,
		end: 8.5,
		current: 0,
	},
	y: {
		/* increasing values move object down */
		start: -58,
		end: -59.5,
		current: 0,
	},
	scrollY: {
		/* increasing values move object down */
		start: 0,
		end: 5,
		current: 0
	},
	zIndex: {
		range: 10000,
	},
	scale: {
		start: 1.2,
		end: 0.9,
	},
	blur: {
		startingDepth: .9,
		range: 20,
	}
};	
output.scale.range = output.scale.end - output.scale.start;
output.x.range = output.x.end - output.x.start;	
output.y.range = output.y.end - output.y.start;	
output.scrollY.range = output.scrollY.end - output.scrollY.start;	
	
var mouse = {
	x: window.innerWidth * .5,
	y: window.innerHeight * .5,
}
	
var updateInputs = function (){
	//mouse x input
	input.mouseX.current = mouse.x;
	//mouse x input - this is the fraction. So it's the mouseX current position, minus the mouseX start divided by the mouseX range
	input.mouseX.fraction = (input.mouseX.current - input.mouseX.start) / input.mouseX.range;
	
	//mouse y input
	input.mouseY.current = mouse.y;
	input.mouseY.fraction = (input.mouseY.current - input.mouseY.start) / input.mouseY.range;
	
	//scroll y input
	input.scrollY.current = html.scrollTop;
	input.scrollY.fraction = (input.scrollY.current - input.scrollY.start) / input.scrollY.range;
	console.log('scroll', input.scrollY.current)
}	
	
var updateOutputs = function (){
	//output x and y
	output.x.current = output.x.end - (input.mouseX.fraction * output.x.range);
	output.y.current = output.y.end - (input.mouseY.fraction * output.y.range);
	output.scrollY.current = output.scrollY.end - (input.scrollY.fraction * output.scrollY.range);
}

var updateEachParallaxItem = function (){
	//apply output to html
	itemsArray.forEach(function (item, k){
	var depth = parseFloat(item.dataset.depth, 10);
		
	var itemInput = {
		scrollY: {
			start: item.offsetParent.offsetTop,
			end: item.offsetParent.offsetTop + window.innerHeight,
		}
	}
	itemInput.scrollY.range = itemInput.scrollY.end - itemInput.scrollY.start;
	itemInput.scrollY.fraction = (input.scrollY.current - itemInput.scrollY.start) / itemInput.scrollY.range;
		
	var itemOutputYCurrent = output.scrollY.end - (itemInput.scrollY.fraction * output.scrollY.range);	
		
	var itemOutput = {
			x: output.x.current - (output.x.current * depth),
			y: output.y.current * depth + (output.y.current - (output.y.current * depth)),
			zIndex: output.zIndex.range - (output.zIndex.range * depth),
			scale: output.scale.start + (output.scale.range * depth),
			blur: (depth - output.blur.startingDepth) * output.blur.range
	};
	console.log(k, 'depth', depth)
		item.style.filter = 'blur('+itemOutput.blur+'px)'
	item.style.zIndex = itemOutput.zIndex;
	item.style.transform = 'scale('+itemOutput.scale+') translate('+itemOutput.x+'px,'+itemOutput.y+'px)';
	});
}
	
var handleMouseMove = function (event){
	mouse.x = event.clientX;
	mouse.y = event.clientY;
	updateInputs();
	
	updateInputs();
	updateOutputs();
	updateEachParallaxItem();
	
	console.log('fraction X', input.mouseX.fraction);
	console.log('fraction Y', input.mouseY.fraction);
}

var handleScroll = function (){
	updateInputs();
	updateOutputs();
	updateEachParallaxItem();
}

var handleResize = function () {
	input.mouseX.end = window.innerWidth;
	input.mouseX.range = input.mouseX.end - input.mouseX.start;
	
	input.mouseY.end = window.innerHeight;
	input.mouseY.range = input.mouseY.end - input.mouseY.start;
	
	input.scrollY.end = html.scrollHeight - window.innerHeight;
	input.scrollY.range = input.scrollY.end - input.scrollY.start;
}
	
window.addEventListener('mousemove', handleMouseMove);
document.addEventListener('scroll', handleScroll);
window.addEventListener('resize', handleResize);
	
updateInputs();
updateOutputs();
updateEachParallaxItem();
</script>
<!-- Sydney end -->
